INSERT INTO `change_request` VALUES ('30745', '6238', 'Allow Deleting Duplicated Product Flat bulk\r\n', 'Current Behavior:\r\n\r\nthere is an ongoing issue that sometimes the system is generating duplicated product flat records which is in correct as it should be generated one time pear the record\r\nand its very hard to delete such records one by one from the interface side\r\n\r\nDesired Behavior:\r\n reference to the attached mail which is showing the communication between us and the BSS team, we need to add the ability to the system to allow us delete the duplicated product flat records as a bulk \r\n\r\nBusiness Impact (Negative effect on business in case of not fulfilling the request) :', '0', '15', '23', null, '23', '0', '2025-06-24 12:24:06', '2025-06-24 12:24:06', '2', '2025-06-24 13:24:06', '2025-06-25 10:24:06', '6', '2025-06-25 11:24:06', '2025-06-29 09:24:06', null, 'mahmoud.bastawisy', 'mahmoud.bastawisy@te.eg', null, null, 'Information Technology', null, '0', '2025-06-24 09:09:53', '2025-06-24 09:51:46', '8', '1', '1', null, '31', '3', 'mahmoud.bastawisy@te.eg', '01060192926', '', null, null, null, null, null);
INSERT INTO `change_request` VALUES ('31023', '6239', 'Correction Action Mantis#248190 Aligned Billing Accounts Bill to Date to be Right Date \"Parent CR\"\r\n', 'Current Behavior: Reference mantis#248190 we found billing accounts has invoices from wrong duration  \"Parent CR\"\r\n\r\nDesired Behavior: Reference mantis# 248190 Correction action : \"Create Parent CR to update \"ToBeAligned=1\",\"AlignmentDone=0\" in Customer product table to algin billing detail to next Quarter , annual and semi-annual\" to correct invoices duration\r\n\r\nBusiness Impact (Negative effect on business in case of not fulfilling the request) : incorrect in invoices duration', '0', '15', '23', null, '23', '0', '2025-06-24 12:24:06', '2025-06-24 12:24:06', '2', '2025-06-24 13:24:06', '2025-06-25 10:24:06', '6', '2025-06-25 11:24:06', '2025-06-29 09:24:06', null, 'mahmoud.bastawisy', 'mahmoud.bastawisy@te.eg', null, null, 'Information Technology', null, '0', '2025-06-24 09:09:53', '2025-06-24 09:51:46', '8', '1', '1', null, '39', '3', 'mahmoud.bastawisy@te.eg', '01060192926', '', null, null, null, null, null);
